export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <div className="container">
            {/*<img src={pokemonImage} ></img>*/}
            {pokemons.map(p => {

                return <ul key={p.number}>
                    <li>name {p.name}:</li>
                    <li>{p.attack}</li>
                </ul>
            })}
        </div>
    );
}
